INSERT INTO `fn_lottery1` VALUES (1,1,'true','1.988','1.988','1.988','1.988','1.988','1.988','2.4','3','3','2.4','1.988','1.988','1.988','1.988','40.5','20.5','13.5','10.125','8.1','9.88','5','10000','5','10000','5','10000','5','5000','5','3000','5','5000',50,'【卓越娱乐房间规则】'),(12,12,'true','1.988','1.988','1.988','1.988','1.988','1.988','2.4','3','3','2.4','1.988','1.988','1.988','1.988','40.5','20.5','13.5','10.125','8.1','9.88','5','10000','5','10000','5','10000','5','5000','5','3000','5','5000',50,'【卓越娱乐房间规则】'),(66,66,'true','1.95','1.95','1.95','1.95','1.95','1.95','3.5','2','2','3.5','2.1','1.7','1.7','2.1','40','21','13','10','8','9.6','10','20000','10','20000','10','20000','10','500','10','3000','10','5000',60,'<div class=\"RuleT1\">【北京赛车】</div>\r\n    <div class=\"RuleT2\">【游戏介绍】</div>\r\n    北京赛车是经国家财政部批准，由北京国家福利彩票管理中心统一发行的赛车主题排列型高频彩票；每期开奖车号共十个,每个车号除了整合玩法，第1~10名、冠亚和值、冠亚组合分别为一个竞猜组，大小/单双/龙虎、车道数字、冠亚大小、冠亚特码、十球全接、特码区段。<br>\r\n    北京赛车、幸运飞艇同以「1~10」十个号码作为开奖依据，完全公平公正公开、开奖透明、无法作弊！<br>\r\n    <br>\r\n    <div class=\"RuleT2\">【相关资料】</div>\r\n    【开奖官网】www.bwlc.net 或www.uc3039.com/<br>\r\n    【官方APP下载】请直接搜索「北京赛车」<br>\r\n    【开奖时间】北京赛车为每天上午09:07~晚上23:57每五分钟开奖一期，每天179期，与官网完全同步。<br>\r\n    <br>\r\n    <div class=\"RuleT2\">【玩法】</div>\r\n    <div class=\"RuleT3\">【1~10名猜大小单双】</div>\r\n    <div class=\"RuleT3\">第一名～第十名车号：开出之号码大于或等于6为大，小于或等于5为小。开出的号码偶数为双，号码奇数为单。</div>\r\n    ■奖历：含本1.95倍<br>\r\n    ■限额：10-20,000<br>\r\n    ■格式：名次/大小单双/金额<br>\r\n    　例：12345/双/100 = 1~5车道买双各100 = 总500<br>\r\n    <div class=\"RuleT3\">【1~10名猜车号】</div>\r\n    <div class=\"RuleT3\">每一个车号为一竞猜组合，开奖结果「竞猜车号」对应所猜「车道」视为中奖，其余情形视为不中奖。</div>\r\n    ■奖历：含本9.6倍<br>\r\n    ■限额：10-10,00<br>\r\n    ■格式：名次/号码/金额<br>\r\n    　例：12345/89/20 = 1~5车道的8号、9号各买20 = 总200<br>\r\n    　例：1357/890/20 = 1.3.5.7车道的8号、9号、10号各买20 = 总240<br>\r\n    <div class=\"RuleT3\">【1~5名猜龙虎】</div>\r\n    <div class=\"RuleT3\">(1)第一名vs第十名，(2)第二名vs第九名，(3)第三名vs第八名，(4)第四名vs第七名，(5)第五名vs第六名，前比后大为龙，反之为虎。</div>\r\n    ■奖历：含本1.95倍<br>\r\n    ■限额：10-20,000<br>\r\n    ■格式：名次/号码/金额<br>\r\n    　例：123/龙/100 = 1~3车道买龙各100=总300<br>\r\n   <div class=\"RuleT3\">【猜冠亚号码】 </div>\r\n<div class=\"RuleT3\">猜冠军及亚军车号（前2名），每次竞猜2个号码，顺序不限。 </div>\r\n■格式：组/号码/金额 <br>\r\n例：组/5-6/50=5号.6号在冠亚军（顺序不限）=总下注50 <br>\r\n例：组/1-9.3-7/100=1.9号车或3.7号车再冠亚军（顺序不限）=总下注200<br>\r\n    <div class=\"RuleT3\">【冠亚和值(特码)猜大小单双】</div>\r\n    <div class=\"RuleT3\">冠军车号+亚军车号 = 冠亚和值 = 特码 = 数字3~19</div>\r\n    <div class=\"RuleT3\">冠亚和值大于或等于12为大，小于或等于11为小。开出的号码偶数为双，号码奇数为单。</div>\r\n    ■奖历：<br>\r\n    　「大」、「双」含本2.1倍。<br>\r\n    　「小」、「单」含本1.7倍。<br>\r\n    ■限额：10-20,000<br>\r\n    ■格式：和/大小单双/金额<br>\r\n    　例：和双100 = 「冠亚和」的双100<br>\r\n    　例：和大100 = 「冠亚和」的大100<br>\r\n    <div class=\"RuleT3\">【冠亚和值(特码)猜数字】</div>\r\n    <div class=\"RuleT3\">「冠亚和值」为「特码」可能出现的结果为3~19，竞猜中对应「冠亚和值」数字的视为中奖，其余视为不中奖。</div>\r\n    ■奖历：<br>\r\n    　3.4.18.19，含本40倍，限额10-1,000<br>\r\n    　5.6.16.17，含本21倍，限额10-2,000<br>\r\n    　7.8.14.15，含本13倍，限额10-3,000<br>\r\n    　9.10.12.13，含本10倍，限额10-4,000<br>\r\n    　11，含本8倍，限额10-5,000<br>\r\n    ■格式：和(特)/数字/金额<br>\r\n    　例：和567/100 = 竞猜「冠亚和」的值为5或6或7各100 = 总300<br>\r\n    <div class=\"RuleT2\">每期下注：总额10万封顶！</div>\r\n    <br>\r\n    <div class=\"RuleT2\">【说明】</div>\r\n    ■没带名次默认竞猜第一名，如「双/100」第一名双100、「123/100」第一名123号各100<br>\r\n    ■竞猜时因各地网路品质不定，可能有1-2秒延迟，以系统判定是否竞猜成功为准。<br>\r\n    ■0号即为10号，竞猜时输入0即为10，输入10即为1、10号。<br>\r\n    　例：0/0/100 = 视为竞猜第10名10号车冠军<br>\r\n    　例：0/100 = 视为竞猜第1名10号车冠军<br>\r\n    <br>\r\n    <div class=\"RuleT2\">若因任何无法抗拒之外力因素导致临时关盘，或是官网问题临时关盘，会员不得在没有下注的情况下以结果论的要求赔偿损失，所有投注皆以会员投注记录明细为主。</div>\r\n'),(444,444,'true','1.988','1.988','1.988','1.988','1.988','1.988','2.4','3','3','2.4','1.988','1.988','1.988','1.988','40.5','20.5','13.5','10.125','8.1','9.88','5','10000','5','10000','5','10000','5','5000','5','3000','5','5000',50,'【卓越娱乐房间规则】'),(6666,6666,'true','1.988','1.988','1.988','1.988','1.988','1.988','2.4','3','3','2.4','1.988','1.988','1.988','1.988','40.5','20.5','13.5','10.125','8.1','9.88','5','10000','5','10000','5','10000','5','5000','5','3000','5','5000',50,'<div class=\"RuleT1\">【北京赛车】</div>\r\n    <div class=\"RuleT2\">【游戏介绍】</div>\r\n北京赛车(PK10)：是经国家财政部批准，由北京福利彩票发行承销的中国福利彩其中一种；每期开奖车号共十个,每个车号除了整合玩法，第1~10名、冠亚和值、冠亚组合分别为一个竞猜组，大小/单双/龙虎、车道数字、冠亚大小、冠亚特码、十球全接、特码区段。 \r\n【相关资料】 \r\n【开奖官网】www.bwlc.net\r\n【开奖时间】09:07~23:57 每5分钟一期，一天共179期。\r\n    <br>\r\n    <div class=\"RuleT2\">【玩法】</div>\r\n    <div class=\"RuleT3\">【1~10名猜大小单双】</div>\r\n    <div class=\"RuleT3\">第一名～第十名车号：开出之号码大于或等于6为大，小于或等于5为小。开出的号码偶数为双，号码奇数为单。</div>\r\n    ■奖历：含本1.98倍<br>\r\n    ■限额：2 - 300,000<br>\r\n    ■格式：名次/大小单双/金额<br>\r\n    　例：12345/双/100 = 1~5车道买双各100 = 总500<br>\r\n    <div class=\"RuleT3\">【1~10名猜车号】</div>\r\n    <div class=\"RuleT3\">每一个车号为一竞猜组合，开奖结果「竞猜车号」对应所猜「车道」视为中奖，其余情形视为不中奖。</div>\r\n    ■奖历：含本9.9倍<br>\r\n    ■限额：2 - 300,000<br>\r\n    ■格式：名次/号码/金额<br>\r\n    　例：12345/89/20 = 1~5车道的8号、9号各买20 = 总200<br>\r\n    　例：1357/890/20 = 1.3.5.7车道的8号、9号、10号各买20 = 总240<br>\r\n    <div class=\"RuleT3\">【1~10名猜组合】</div>\r\n    <div class=\"RuleT3\">竞猜内容为「大单」「小双」「小单」「大双」，共4种。</div>\r\n    <br>\r\n<div class=\"RuleT3\">【1~5名猜龙虎】</div>\r\n    <div class=\"RuleT3\">(1)第一名vs第十名，(2)第二名vs第九名，(3)第三名vs第八名，(4)第四名vs第七名，(5)第五名vs第六名，前比后大为龙，反之为虎。</div>\r\n    ■奖历：含本1.98倍<br>\r\n    ■限额：2 - 300,000<br>\r\n    ■格式：名次/号码/金额<br>\r\n    　例：123/龙/100 = 1~3车道买龙各100=总300<br>\r\n   <div class=\"RuleT3\">【猜冠亚号码】 </div>\r\n<div class=\"RuleT3\">猜冠军及亚军车号（前2名），每次竞猜2个号码，顺序不限。 </div>\r\n■格式：组/号码/金额 <br>\r\n例：组/5-6/50=5号.6号在冠亚军（顺序不限）=总下注50 <br>\r\n例：组/1-9.3-7/100=1.9号车或3.7号车再冠亚军（顺序不限）=总下注200<br>\r\n    <div class=\"RuleT3\">【冠亚和值(特码)猜大小单双】</div>\r\n    <div class=\"RuleT3\">冠军车号+亚军车号 = 冠亚和值 = 特码 = 数字3~19</div>\r\n    <div class=\"RuleT3\">冠亚和值大于或等于12为大，小于或等于11为小。开出的号码偶数为双，号码奇数为单。</div>\r\n    ■奖历：<br>\r\n    　「大」、「双」含本2.15倍。<br>\r\n    　「小」、「单」含本1.75倍。<br>\r\n    ■限额：2 - 300,000<br>\r\n    ■格式：和(特)/大小单双/金额<br>\r\n    　例：和双100 = 「冠亚和」的双100<br>\r\n    　例：和大100 = 「冠亚和」的大100<br>\r\n    <div class=\"RuleT3\">【冠亚和值(特码)猜数字】</div>\r\n    <div class=\"RuleT3\">「冠亚和值」为「特码」可能出现的结果为3~19，竞猜中对应「冠亚和值」数字的视为中奖，其余视为不中奖。</div>\r\n    ■奖历：<br>\r\n    　3.4.18.19，含本42倍，限额2-5,000<br>\r\n    　5.6.16.17，含本21倍，限额2-5,000<br>\r\n    　7.8.14.15，含本14倍，限额2-5,000<br>\r\n    　9.10.12.13，含本10倍，限额2-5,000<br>\r\n    　11，含本8倍，限额2-5,000<br>\r\n    ■格式：和/数字/金额<br>\r\n    　例：和567/100 = 竞猜「冠亚和」的值为5或6或7各100 = 总300<br>\r\n    <div class=\"RuleT2\">【说明】</div>\r\n    ■没带名次默认竞猜第一名，如「双/100」第一名双100、「123/100」第一名123号各100<br>\r\n    ■竞猜时因各地网路品质不定，可能有1-2秒延迟，以系统判定是否竞猜成功为准。<br>\r\n    ■0号即为10号，竞猜时输入0即为10，输入10即为1、10号。<br>\r\n    　例：0/0/100 = 视为竞猜第10名10号车冠军<br>\r\n    　例：0/100 = 视为竞猜第1名10号车冠军<br>\r\n    <div class=\"RuleT2\">每期下注：总额10万封顶！</div>\r\n    <br>\r\n    <br>\r\n    <div class=\"RuleT2\">若因任何无法抗拒之外力因素导致临时关盘，或是官网问题临时关盘，会员不得在没有下注的情况下以结果论的要求赔偿损失，所有投注皆以会员投注记录明细为主。</div>'),(8888,8888,'true','1.988','1.988','1.988','1.988','1.988','1.988','2.4','3','3','2.4','1.988','1.988','1.988','1.988','40.5','20.5','13.5','10.125','8.1','9.88','5','10000','5','10000','5','10000','5','5000','5','3000','5','5000',50,'【卓越娱乐房间规则】');
