000、111..999等<br>\r\n    顺子：如234、890、901…等(顺序不限)<br>\r\n    对子：如001、288、585…等(不包括豹子)<br>\r\n    半顺：所竞猜位置的三位数开出号码任意两个顺序数字相连（不包括顺子、对子，号码9、0、1相连）。如235、378、283…等。<br>\r\n    ※如果开奖号码为前三顺子、前三对子，则前三半顺视为不中奖。 <br>\r\n    杂六：所竞猜位置的三位数开出号码皆不相同且不能为连号，视为杂六。如179、264、802…等。<br>\r\n    ※如果开奖号码为中三豹子、中三顺子、中三对子、中三半顺，则杂六视为不中奖。<br>\r\n    赔率、限额：<br>\r\n    豹子含本80倍，限额5-2000<br>\r\n    顺子含本14倍，限额10-10000<br>\r\n    对子含本3.0倍，限额10-20000<br>\r\n    半顺含本2.4倍，限额10-20000<br>\r\n    杂六含本2.6倍，限额10-20000<br>\r\n    格式：定位/种类/金额<br>\r\n    例：前/对子/300 = 买前对子300<br>\r\n    例：中/豹子/100 = 买中豹子100<br>\r\n    例：后/杂六/100 = 买后杂六100<br>\r\n    <div class=\"RuleT3\">【五球总和】</div>\r\n    <div class=\"RuleT3\">总和大小：万、千、百、十、个五个位数加总作为开奖依据，五位数总和0~22为小，23~45为大。 </div>\r\n    <div class=\"RuleT3\">总和单双：万、千、百、十、个五个位数加总作为开奖依据，五位数总和1、3、5…43、45为单，总和0、2、4、6…42、44为双。 </div>\r\n    赔率：含本1.96倍<br>\r\n    限额：20-20000<br>\r\n    格式：大、小、单、双/金额<br>\r\n    例：总大200 <br>\r\n    例：总单100<br>\r\n    <div class=\"RuleT3\">【龙虎】</div>\r\n    <div class=\"RuleT3\">万位数为龙、个位数为虎，以万、个两位数比大小，号码0为最小、9为最大。开奖第一球万大于第五球个为龙，反之为虎。万、个两位数号码相同，则为和。</div>\r\n    赔率：<br>\r\n    「龙」含本1.96倍<br>\r\n    「虎」含本1.96倍<br>\r\n    「和」含本9倍<br>\r\n    限额：10-20000<br>\r\n    格式：龙、虎、和/金额<br>\r\n    例：龙/200<br>\r\n    例：和/100<br>\r\n    <div class=\"RuleT3\">【包号】</div>\r\n    <div class=\"RuleT3\">包号投注与一星投注的结算方法相同。例如下包/1/100，则下注将为12345/1/100，开奖结果5球内如果有1则视为中奖，反之未中奖！</div>\r\n    赔率：<br>\r\n    含本9.80倍<br>\r\n    限额：5-10000<br>\r\n    格式：包/球号/金额<br>\r\n    例：包/1/200<br>\r\n    例：包1.100<br>\r\n    <div class=\"RuleT3\">【单码】</div>\r\n    <div class=\"RuleT3\">单号投注与一星投注的结算方法相同。例如下1/100(不加球号)，开奖结果5球内如果有1则视为中奖，反之未中奖！</div>\r\n    赔率：<br>\r\n   中1, 含本9.80倍<br>\r\n   中2, 含本19.6倍<br>\r\n   中3, 含本29.4倍<br>\r\n   中4, 含本39.2倍<br>\r\n   中5, 含本49.0倍<br>\r\n    限额：5-10000<br>\r\n    格式：球号/金额<br>\r\n    例：1/200 = 单码1/200<br>\r\n    例：单码/1/200<br>\r\n    <div class=\"RuleT2\">每期下注总额10万封顶！每天不计输赢流水1001以上反水1%</div>\r\n    <br>\r\n    <br>\r\n    <div class=\"RuleT2\">若因任何无法抗拒之外力因素导致临时关盘，或是官网